//페이지 공통된 것 처리
//index,profile,signup의 부모 역할! Component에 들어가게 됨
import React from "react";
import "antd/dist/antd.css";
import PropTypes from "prop-types";

const App = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

//proptypes 점검으로 로 안정성 높일 수 있음
App.protypes = {
  Component: PropTypes.elementType.isRequired,
};
export default App;
